import React from 'react';
import './App.css';
import {LandingPage} from './views'
import {Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <Route exact path = '/' component = {LandingPage} />
      </header>
    </div>
  );
}

export default App;
